    false,nt"url": null,nt"notes": "This side scan sonar image of the sea floor
    was mosaiced from data collected in July 2005 onboard the NOAA vessel Tatoosh. An
    EG&G 272 side scan system was used for geophysical surveying using 100Khz data.
    A Trimble DSM212Ldifferential GPS was used for positioning. Navigation from the
    GPS were logged in Hypack version 2.6 (CoastalOceanographics). Isis Sonar (Triton
    Imaging International) was used to log the sonar packets and cable counter data.
    Sonar data were captured using at an 112m range scale setting.",nt"license_title":
